import React from "react";
import { useRouter } from "next/router";

const ResetPasswordPage: React.FC = () => {
  const router = useRouter();
  const { uuid } = router.query;

  return (
    <div>
      <p>{uuid}</p>
    </div>
  );
};

export default ResetPasswordPage;
